import React from 'react';
import MainLayout from './components/MainLayout'
import Header from './components/Header'
import Main from './components/Main'
import Footer from './components/Footer'
import { ThemeProvider } from 'styled-components'

const theme = {
  bg: 'white',
  fg: 'black'
}


const projects = [
  {
    title: 'MyReads',
    description: 'description',
    imageURL: 'images/thumbs/myreads.jpg',
    liveLink: '#',
    gitLink: '#'
  },
  {
    title: 'Weather Journal',
    description: 'description',
    imageURL: 'images/thumbs/weather_journal.jpg',
    liveLink: '#',
    gitLink: '#'
  },
  {
    title: 'Blog of Trees',
    description: 'description',
    imageURL: 'images/thumbs/blog_of_trees.jpg',
    liveLink: '#',
    gitLink: '#'
  },
  {
    title: 'Reciper',
    description: 'description',
    imageURL: 'images/thumbs/reciper.jpg',
    liveLink: '#',
    gitLink: '#'
  },
  {
    title: 'Random Trees',
    description: 'description',
    imageURL: 'images/thumbs/random_trees.jpg',
    liveLink: '#',
    gitLink: '#'
  }
]
function App() {
  return (
    <ThemeProvider theme={theme}>
      <MainLayout>
          <Header />
          <Main projects={projects} />
          <Footer />
      </MainLayout>
    </ThemeProvider>
  );
}

export default App;
